// src/components/Navbar.js
import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';  // Link para navegação

function MyNavbar() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary fixed-top">
      <Container>
        <Navbar.Brand href="/">Currículo</Navbar.Brand>
        <Nav className="mx-auto">
          <Nav.Link as={Link} to="/exibir">Exibir Currículo</Nav.Link>
          <Nav.Link as={Link} to="/editar">Editar Currículo</Nav.Link>
        </Nav>
        <img
          src="https://via.placeholder.com/40"  // Imagem avatar
          alt="Avatar"
          className="rounded-circle"  // Faz a imagem ficar redonda
        />
      </Container>
    </Navbar>
  );
}

export default MyNavbar;
